import React from 'react'
import './App.css'
import Col from 'react-bootstrap/Col'



function List({list}) {
    const postlist = list.length ? (
        list.map(movie => {
            return (
                <Col xs = {12} sm = {4} md = {3} large = {2} xl = {2} className = "mb-3 mt-3 justify-content-center text-center">

                    <div className='box '>
                        <a href={movie.thumbnail_link}>
                            <img className=' mb-3' src={movie.thumbnail_link} alt={movie.movie_id}
                                style={{ borderRadius: 10, width: 130, height: 200 }} />
                        </a>
                    </div>
                </Col>
            )
        })
    ) : (
            <div className="text-center">
                Loading
            </div>
        )


    return (
        <div className='container body-cont' style={{ paddingTop: 5, paddingBottom: 15 }}>
            <main>
                <div className='container'>
                    <button type='button' className='btn btn-outline-primary my-3'>
                        Catalogue {' '}
                        <i className='fa fa-chevron-right' style={{ marginTop: 4 }}>
                        </i>
                    </button>
                    <div className='row'>
                        {postlist}
                    </div>
                </div>

            </main>
        </div>
    )
}

export default List;
